fields.description:
Mould remediation required as per EDp report. 
Cleaning should consist of HEPA vacuuming and wiping down of accessible surfaces with a detergent solution and microfibre cloth;
It is recommended to engage a suitably trained and qualified mould remediation specialist to perform appropriate remediation works at the site outlined in Section 8.4 in line with the Institute of Inspection Cleaning and Restoration Certification (IICRC) with particularreference to s500 and s520

fields.scope:
- Site establishment; Secure a safe working area which will be barricaded off using highly visible reflective 
equipment allowing for foot traffic to be diverted and access kept safe; 
- Carry out risk assessment and work method statement;
- Clear the channels of debris, and accumulated leaves;
- Take a measurement of the depth of the channel empty;
- Seprate the channel into three sections
    Section A û Surrounding Tank 1
    Section B û Surrounding Tank 2
    Section C û Central Section
    And Separate the Sump;
- Fill the specific section with water and cover with available metal plates or similar;
- Have our technicians attend in the morning and the evening to take readings/measurements of the drop in water level in each section of the drainage channels for 3 days. Noting that any drop in water level after 48 hours would indicate the potential for a water leak;
- Repeat for each section and sump;
- Have our technician provide a brief report on Pedwards letter head of the observations, methodology and readings û including noting environmental conditions.
- Clean site and Handover

